                            </p>
                        </Col>
                        <Col xs={4}>
                            <p>
                                <FontAwesomeIcon icon={faEnvelope} /> somserve@uw.edu
                            </p>
                        </Col>
                    </ Row>
                </Container>
            </div>
        )
    }
}
